import React, { useEffect, useState } from "react";
import { Button, Col, Form, Row } from "react-bootstrap";
import { useDispatch, useSelector } from "react-redux";
import { useNavigate } from "react-router-dom";

import Message from "../components/Message";
import AlertMessage from "../components/AlertMessage";

/**
 * add Alert message on error or success
 */
function SettingsScreen() {
    const navigate = useNavigate();
    const dispatch = useDispatch();

    const [message, setMessage] = useState("");
    const [form, setForm] = useState({
        name: "",
        email: "",
        password: "",
        confirmPassword: "",
    });

    console.log(form);

    const userLogin = useSelector((state) => state.userLogin);
    const { userInfo } = userLogin;

    const handleChange = (e) => {
        setForm({
            ...form,
            [e.target.name]: e.target.value,
        });
    };

    const submitHandler = (e) => {
        e.preventDefault();
        setMessage("");

        if (form.password !== form.confirmPassword) {
            setMessage("Passwords do not match");
        } else {
            const x = {
                name: form.name,
                email: form.email,
                password: form.password,
            };
            console.log(x);
            // dispatch(register(form.name, form.email, form.password));
        }
    };

    useEffect(() => {
        if (!userInfo) {
            navigate("/");
        } else {
            console.log("here:", userInfo.name);
            setForm((prevForm) => ({
                ...prevForm,
                name: userInfo.name, // Set the name field to userInfo.name
            }));
        }
    }, [navigate, userInfo]);

    return (
        <div className="route-container screen-container d-flex flex-column justify-content-center align-items-center h-100">
            <div className="login-registration-header">
                <h1>Hello!</h1>
                Thanks for trying us out!{" "}
            </div>
            {/* <div className="other-sign-in-options-container">
                <Button
                    type="submit"
                    variant="light"
                    className="w-100 rounded-pill mt-2 fw-bold"
                >
                    Google
                </Button>
            </div> */}
            <div className="separator-container mt-4">
                <div className="line left-line"></div>
            </div>
            <div className="login-registration-form">
                <Form onSubmit={submitHandler} id="login-form">
                    <Form.Group controlId="name" className="form-group-c">
                        <Form.Label className="fw-bold mb-1">Name</Form.Label>
                        <Form.Control
                            required
                            type="name"
                            placeholder="John Smith"
                            value={form.name}
                            name="name"
                            onChange={handleChange}
                            autoComplete="off"
                            className="rounded-pill"
                        ></Form.Control>
                    </Form.Group>

                    <Form.Group controlId="email" className="form-group-c">
                        <Form.Label className="fw-bold mb-1">Email</Form.Label>
                        <Form.Control
                            type="email"
                            placeholder="E.g. yourname@email.com"
                            name="email"
                            onChange={handleChange}
                            autoComplete="off"
                            className="rounded-pill"
                        ></Form.Control>
                    </Form.Group>

                    <Form.Group controlId="password" className="form-group-c">
                        <Form.Label className="fw-bold mb-1">
                            Password
                        </Form.Label>
                        <Form.Control
                            type="password"
                            placeholder="Enter your password"
                            name="password"
                            onChange={handleChange}
                            className="rounded-pill"
                        ></Form.Control>
                    </Form.Group>

                    <Form.Group
                        controlId="passwordConfirm"
                        className="form-group-c"
                    >
                        <Form.Label className="fw-bold mb-1">
                            Confirm Password
                        </Form.Label>
                        <Form.Control
                            required
                            type="password"
                            placeholder="Confirm password"
                            name="confirmPassword"
                            onChange={handleChange}
                            className="rounded-pill"
                        ></Form.Control>
                    </Form.Group>
                    <Button
                        type="submit"
                        variant="primary"
                        className="w-100 rounded-pill mt-2"
                    >
                        Update profile
                    </Button>
                </Form>

                {/* <Row className="py-3">
                    <Col>
                        {error && (
                            <div className="d-flex flex-row">
                                <Message variant="danger">{error}</Message>
                            </div>
                        )}
                    </Col>
                </Row> */}

                {message && (
                    <Row className="py-3">
                        <Col>
                            <div className="d-flex flex-row">
                                <Message variant="danger">{message}</Message>
                            </div>
                        </Col>
                    </Row>
                )}
            </div>
        </div>
    );
}

export default SettingsScreen;
